import React from 'react';
import { HouseFill, MenuButtonWideFill, BookFill, FolderSymlinkFill } from 'react-bootstrap-icons';

/// Router
import { Link } from 'react-router-dom';
import CrackOffCampus from '../CrackOffCampus-Jobs/CrackOffCampus/CrackOffCampus';

function NavbarComponent(props) {
    { console.log(props.data) }
    return (
        <div class="Navbar">
            <nav class="navbar navbar-expand-lg navbar-light bg-light">

                <a class="navbar-brand" href="#">Crack Off Campus</a>
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarNav">
                    <ul class="navbar-nav">
                        <li class="nav-item active">
                           
                                <HouseFill style={{ marginRight: "7px" }} id="logo_account" color="#000" size={23} />
                                <a class="nav-link" href="#">Home <span class="sr-only"></span></a>
                            
                        </li>
                        <li class="nav-item">
                            <MenuButtonWideFill style={{ marginRight: "7px" }} id="logo_account" color="#000" size={23} />
                            <a class="nav-link" href="#">Seewe</a>
                        </li>
                        <li class="nav-item">
                            <BookFill style={{ marginRight: "7px" }} id="logo_account" color="#000" size={23} />
                            <a class="nav-link" href="#">Courses</a>
                        </li>
                        <li class="nav-item">
                            <FolderSymlinkFill style={{ marginRight: "7px" }} id="logo_account" color="#000" size={23} />
                            <a class="nav-link" href="#">Referals</a>
                        </li>
                    </ul>
                </div>

            </nav>
        </div>
    )
}

export default NavbarComponent;
